import React from 'react'

const TreatmentDetails = (props) => {
    return (
        <div className='d-flex justify-content-center align-items-center border border-dark m-4'>
            <div>
                {props.data.title}
            </div>
            <div> {props.data.detail_page.details}</div>
            <div>
                {props.data.detail_page.image}
            </div>
        </div>
    )
}

export default TreatmentDetails
